import React from "react"
import {
    AdaptivityProvider,
    ConfigProvider,
    useAdaptivity,
    AppRoot,
    SplitLayout,
    SplitCol,
    ViewWidth,
    View,
    Panel,
    PanelHeader,
    Header,
    Group,
    SimpleCell,
    withAdaptivity,
    CellButton,
    PopoutWrapper,
    ModalDismissButton,
    Button,
    Div,
    Title
  } from "@vkontakte/vkui";
  import "@vkontakte/vkui/dist/vkui.css";

export default function ShowButtons(todos, button1) {
    return(
        <Div>
            {
                todos[0].completed === false
            ?
                <Button size="l" onClick={button1}>1</Button>
            :
                <Button size="l" onClick={button1} mode="secondary">1</Button>
            }
        </Div>
);
};
